import React from 'react'
import { Link } from "react-router-dom"
import "./Navbar.css";
function Navbar() {
    return (
        <div className='Navbar'>
            <div className='nav-items'>
                <Link to="/">Home</Link>
                <Link to="/project">Projects</Link>
                <Link to="/contact">Contact</Link>
            </div>
        </div>
    )
}

export default Navbar
